import React from "react";
import './bodyAboutMe.css';


class bodyAboutMe extends React.Component {
    render() {
        return (
            <div className={this.props.className}>
                <div className="container-splitter">
                    <div className="col-container">
                        <h1>About Me</h1>
                        <p className="AboutMeDescription">{this.props.AboutMeDescription}</p>
                    </div>
                    <div className="col-container">
                        <h1>Bio</h1>
                        <div className="bio-row-conteiner">
                            <div className="bio-col"></div>
                        </div>
                        
                    </div>
                </div>
            </div>
        )


    }

}
 export default bodyAboutMe;
